DROP TABLE IF EXISTS `client`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `client` (
  `client_id` int(11) NOT NULL AUTO_INCREMENT,
  `email_id` varchar(100) DEFAULT NULL,
  `password` varchar(100) DEFAULT NULL,
  `client_type` varchar(25) DEFAULT NULL,
  `industry_details_id` int(11) DEFAULT NULL,
  `client_name` varchar(255) DEFAULT NULL,
  `website` varchar(50) DEFAULT NULL,
  `address1` varchar(255) DEFAULT NULL,
  `address2` varchar(255) DEFAULT NULL,
  `address3` varchar(255) DEFAULT NULL,
  `city_id` int(11) DEFAULT NULL,
  `state_id` int(11) DEFAULT NULL,
  `country_id` int(11) DEFAULT NULL,
  `pincode` varchar(10) DEFAULT NULL,
  `contact_person` varchar(255) DEFAULT NULL,
  `contact_number` varchar(50) DEFAULT NULL,
  `landlineno_id` int(11) DEFAULT NULL,
  `token_id` varchar(100) DEFAULT NULL,
  `isAuth` varchar(50) DEFAULT NULL,
  `status` char(1) DEFAULT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` varchar(30) NOT NULL,
  `modified_date` datetime DEFAULT CURRENT_TIMESTAMP,
  `company_name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`client_id`),
  KEY `city_id` (`city_id`),
  KEY `state_id` (`state_id`),
  KEY `industry_details_id` (`industry_details_id`),
  KEY `country_id` (`country_id`),
  CONSTRAINT `client_ibfk_1` FOREIGN KEY (`city_id`) REFERENCES `city` (`city_id`),
  CONSTRAINT `client_ibfk_2` FOREIGN KEY (`state_id`) REFERENCES `state` (`state_id`),
  CONSTRAINT `client_ibfk_3` FOREIGN KEY (`industry_details_id`) REFERENCES `industry_details` (`industry_details_id`),
  CONSTRAINT `client_ibfk_4` FOREIGN KEY (`country_id`) REFERENCES `country` (`country_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;
