CREATE TABLE `college` (
  `college_id` int(8) NOT NULL AUTO_INCREMENT,
  `college_code` varchar(20) DEFAULT NULL,
  `description` varchar(100) DEFAULT NULL,
  `university_id` int(8) DEFAULT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` varchar(30) NOT NULL,
  `modified_date` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`college_id`),
  KEY `university_id` (`university_id`),
  CONSTRAINT `college_ibfk_1` FOREIGN KEY (`university_id`) REFERENCES `university` (`university_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1953 DEFAULT CHARSET=utf8;
